import React from 'react';
import './CompanyFilter.css';

function CompanyFilter({ companies, selected, onToggle }) {
  return (
    <div className="company-filter">
      <h2>Filter by Company</h2>
      {companies.map(company => (
        <label key={company} style={{ display: 'block', margin: '4px 0' }}>
          <input
            type="checkbox"
            value={company}
            checked={selected.includes(company)}
            onChange={() => onToggle(company)}
          />
          {company}
        </label>
      ))}
    </div>
  );
}

export default CompanyFilter;
